// pdfExport.js - Generate PDF report

function generatePDFReport(results, formData) {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();
  
  const forestGreen = [45, 80, 22];
  const lightGray = [108, 117, 125];
  const black = [26, 26, 26];
  
 let yPos = 20;
const leftMargin = 20;
const pageWidth = 190;
const pageHeight = doc.internal.pageSize.height;
  
  // Helper function to add new page if needed
  function checkPageBreak(neededSpace) {
    if (yPos + neededSpace > 280) {
      doc.addPage();
      yPos = 20;
    }
  }
  
// LOGO
  const logoData = '';
  const logoWidth = 27;
  const logoHeight = 15;
  doc.addImage(logoData, 'PNG', (pageWidth - logoWidth) / 2, yPos, logoWidth, logoHeight);
  yPos += 20;
  
  doc.setFontSize(16);
  doc.setTextColor(...black);
  doc.text('Directional Emissions Estimate', pageWidth / 2, yPos, { align: 'center' });
  yPos += 10;

  
  // EXECUTIVE SUMMARY
doc.setFontSize(16);
doc.setTextColor(...forestGreen);
yPos += 10;  // Add this line for extra space
doc.text('Executive Summary', leftMargin, yPos);
yPos += 10;
  
  doc.setFontSize(11);
  doc.setTextColor(...black);
  
  // Company name and date
  doc.setFontSize(12);
  doc.setTextColor(...lightGray);
  const companyName = formData.companyBasics.industry.replace(/_/g, ' ').toUpperCase();
  doc.text(`${companyName} | ${new Date().toLocaleDateString()}`, leftMargin, yPos);
  yPos += 15;

  // Total emissions box
  doc.setFillColor(248, 249, 250);
  doc.rect(leftMargin, yPos, pageWidth, 25, 'F');
  doc.setFontSize(20);
  doc.setTextColor(...forestGreen);
  doc.text(`${results.summary.total.toLocaleString()} tCOe`, leftMargin + 5, yPos + 10);
  doc.setFontSize(10);
  doc.setTextColor(...lightGray);
  doc.text('Total Annual Emissions', leftMargin + 5, yPos + 18);
  yPos += 30;
  
  // Scope breakdown
  doc.setFontSize(11);
  doc.setTextColor(...black);
  doc.text(`Scope 1 (Direct): ${results.summary.scope1.toLocaleString()} tCOe (${((results.summary.scope1/results.summary.total)*100).toFixed(1)}%)`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Scope 2 (Electricity): ${results.summary.scope2.toLocaleString()} tCOe (${((results.summary.scope2/results.summary.total)*100).toFixed(1)}%)`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Scope 3 (Value Chain): ${results.summary.scope3.toLocaleString()} tCOe (${((results.summary.scope3/results.summary.total)*100).toFixed(1)}%)`, leftMargin, yPos);
  yPos += 15;
  
  checkPageBreak(40);
  
  // INTENSITY METRICS
  doc.setFontSize(14);
  doc.setTextColor(...forestGreen);
  doc.text('Intensity Metrics', leftMargin, yPos);
  yPos += 10;
  
  doc.setFontSize(11);
  doc.setTextColor(...black);
  doc.text(`Per Employee: ${results.intensityMetrics.perEmployee.toLocaleString(undefined, {maximumFractionDigits: 2})} tCOe`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Per $M Revenue: ${results.intensityMetrics.perRevenue.toLocaleString(undefined, {maximumFractionDigits: 1})} tCOe`, leftMargin, yPos);
  yPos += 15;
  
  checkPageBreak(40);
  
  // INDUSTRY COMPARISON
  doc.setFontSize(14);
  doc.setTextColor(...forestGreen);
  doc.text('Industry Comparison', leftMargin, yPos);
  yPos += 10;
  
  doc.setFontSize(11);
  doc.setTextColor(...black);
  doc.text(`Your Company: ${results.industryComparison.companyTotal.toLocaleString()} tCOe`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Industry Average: ${results.industryComparison.industryAverage.toLocaleString()} tCOe`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Variance: ${results.industryComparison.variance.toFixed(1)}% (${results.industryComparison.interpretation})`, leftMargin, yPos);
  yPos += 15;
  
  checkPageBreak(80);
  
  // SCOPE 3 BREAKDOWN
  doc.setFontSize(14);
  doc.setTextColor(...forestGreen);
  doc.text('Scope 3 Breakdown by Category', leftMargin, yPos);
  yPos += 10;
  
  doc.setFontSize(10);
  doc.setTextColor(...black);
  
const scope3Categories = [
  { name: 'Cat 1: Purchased Goods & Services', value: results.breakdown.scope3.purchasedGoods },
  { name: 'Cat 2: Capital Goods', value: results.breakdown.scope3.capitalGoods },
  { name: 'Cat 3: Fuel & Energy Related', value: results.breakdown.scope3.fuelEnergy },
  { name: 'Cat 5: Waste', value: results.breakdown.scope3.waste },
  { name: 'Cat 6: Business Travel', value: results.breakdown.scope3.businessTravel },
  { name: 'Cat 7: Employee Commuting', value: results.breakdown.scope3.commuting },
  { name: 'Cat 9: Downstream Transport', value: results.breakdown.scope3.downstreamTransport },
  { name: 'Cat 11: Use of Sold Products', value: results.breakdown.scope3.useOfProducts },
  { name: 'Cat 12: End-of-Life', value: results.breakdown.scope3.endOfLife }
];
  
// Table header
const tableMargin = 10; // Reduced margin for table
doc.setFillColor(...forestGreen);
doc.rect(tableMargin, yPos, pageWidth, 8, 'F');
doc.setTextColor(255, 255, 255);
doc.text('Category', tableMargin + 2, yPos + 5);
doc.text('Emissions (tCOe)', tableMargin + 100, yPos + 5);
doc.text('% of Scope 3', tableMargin + 150, yPos + 5);
yPos += 10;

doc.setTextColor(...black);
scope3Categories.forEach((cat, index) => {
  checkPageBreak(8);
  
  if (index % 2 === 0) {
    doc.setFillColor(248, 249, 250);
    doc.rect(tableMargin, yPos - 4, pageWidth, 7, 'F');
  }
  
  const percent = results.summary.scope3 > 0 ? ((cat.value / results.summary.scope3) * 100).toFixed(1) : 0;
  doc.text(cat.name, tableMargin + 2, yPos);
  doc.text(cat.value.toLocaleString(undefined, {maximumFractionDigits: 1}), tableMargin + 100, yPos);
  doc.text(`${percent}%`, tableMargin + 150, yPos);
  yPos += 7;
});
  
  // Add note about excluded categories
  yPos += 5;
  checkPageBreak(20);
  doc.setFontSize(8);
  doc.setTextColor(...lightGray);
  doc.text('Note: Categories 4 (Upstream Transport), 8 (Upstream Leased Assets), 10 (Processing of Sold Products),', leftMargin, yPos);
  yPos += 4;
  doc.text('13 (Downstream Leased Assets), 14 (Franchises), and 15 (Investments) are not included as they apply', leftMargin, yPos);
  yPos += 4;
  doc.text('to specific business models and require detailed operational data not captured in this screening-level assessment.', leftMargin, yPos);
  
  yPos += 10;
  checkPageBreak(30);
  
  // CONFIDENCE SCORE
  doc.setFontSize(14);
  doc.setTextColor(...forestGreen);
  doc.text('Data Confidence', leftMargin, yPos);
  yPos += 10;
  
  doc.setFontSize(11);
  doc.setTextColor(...black);
  doc.text(`Confidence Level: ${results.confidence.level} (${results.confidence.score}%)`, leftMargin, yPos);
  yPos += 7;
  doc.text(`Based on ${results.confidence.questionsAnswered} of ${results.confidence.totalQuestions} data points`, leftMargin, yPos);
  yPos += 15;
  
  // FOOTER
  doc.setFontSize(8);
  doc.setTextColor(...lightGray);
  const pageCount = doc.internal.getNumberOfPages();
 for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.text(`Generated by GBB Strategy's Directional Emissions Tool | Page ${i} of ${pageCount}`, pageWidth / 2, pageHeight - 10, { align: 'center' });
    doc.setFontSize(8);
    doc.text('info@gbbstrategy.com', pageWidth / 2, pageHeight - 5, { align: 'center' });
  }
  
  // Save PDF
  const fileName = `carbon-footprint-report-${new Date().toISOString().split('T')[0]}.pdf`;
  doc.save(fileName);
}